        <div className="container-fluid">
           <Navbar /> 
           <div className="row">
            <div className="col-sm-6 col-md-6 col-lg-12">
              <img src="/drawings/a.jpg"></img>
            </div>
            <div className="col-sm-6 col-md-6 col-lg-12">
            <img src="/drawings/b.jpg"></img>
            </div>
            <div className="col-sm-6 col-md-6 col-lg-12">
              <img src="/drawings/c.jpg"></img>  
            </div>
           </div>
        </div>
    )
}

export default Works;
